import React from 'react'
import {Button} from 'react-bootstrap'

export default class AddToCartComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            open: false,
            setOpen: false
        };
      }

    render() {
        return <div className='container'>
            <h1>Add to cart component worksS</h1>
            <table className='table'>
                <tbody>
                    <thead>
                        <tr>
                            <th>Item Type</th>
                            <th>Processor</th>
                        </tr>
                    </thead>
                    <tr>
                        <td>fdsf</td>
                        <td></td>
                    </tr>
                </tbody>
            </table>
        </div>
    }
}
